/** @format */
import React from 'react';

function Nav() {
	return (
		<>
			<div className='relative'>
				<div className=' bg-black text-white fixed top-0'>
					<div className='flex justify-between	'>
						<h1 className='font-extrabold'>My Logo</h1>
						<div className='flex'>
							<a className='font-bold'>Project</a>
							<a className='ml-8 font-bold'>Team</a>
						</div>
					</div>
				</div>
			</div>
		</>
	);
}

export default Nav;
